_lang_keno_terms:
Classic Keno: A virtual game where the player has the opportunity to choose the number of guessing balls one to ten from 80 possibilities. There are eighty balls numbered from 1 up to 80. During the draw game, the system throws 20 balls at random, from 1 to 80. The durations of the session are fixed. 
Player is also able to use “quick bet” function, when system randomly generates 3, 4, 5, 6, 7, 8, 9 or 10 numbers and user can bet on their favorite. 
Possible outcome depends on how many numbers are chosen by user and how many of them are guessed correctly:
If user chooses 1 number, he will win in case when he guesses this number correctly.
Win multiplier is 3.
If user chooses 2 numbers, he will win in case when he guesses at least one of these two numbers. User will be payed according to the following rules:
1 out of 2 – win multiplier = 1;
2 out of 2 numbers – win multiplier = 10.
If user chooses 3 numbers, he will win in case when he guesses at least two out of this three numbers. User will be payed according to the following rules:
2 out of 3 - win multiplier = 2;
3 out of 3 – win multiplier = 45.
If user chooses 4 numbers, he will win in case when he guesses at least 2 numbers out of 4. User will be payed according to the following rules:
2 out of 4 – win multiplier = 1;
3 out of 4 – win multiplier = 10;
4 out of 4 – win multiplier = 100.
If user chooses 5 numbers, he will win in case when he guesses at least 2 numbers out of 5. User will be payed according to the following rules:
2 out of 5 – win multiplier = 1;
3 out of 5 – win multiplier = 3;
4 out of 5 – win multiplier = 20;
5 out of 5 – win multiplier = 200.
If user chooses 6 numbers, he will win in case when he guesses at least 3 numbers out of 6. User will be payed according to the following rules:
3 out of 6 – win multiplier = 2;
4 out of 6 – win multiplier = 15;
5 out of 6 – win multiplier = 60;
6 out of 6 – win multiplier = 550.
If user chooses 7 numbers, he will win in case when he guesses at least 3 numbers out of 7 or could not manage to guess any number. User will be payed according to the following rules:
0 out of 7 – win multiplier = 1;
3 out of 7 – win multiplier = 2;
4 out of 7 – win multiplier = 4;
5 out of 7 – win multiplier = 15;
6 out of 7 – win multiplier = 80;
7 out of 7 – win multiplier = 2000.
If user chooses 8 numbers, he will win in case when he guesses at least 4 numbers out of 8 or could not manage to guess any number. User will be payed according to the following rules:
0 out of 8 – win multiplier = 1;
4 out of 8 – win multiplier = 5;
5 out of 8 – win multiplier = 10;
6 out of 8 – win multiplier = 50;
7 out of 8 – win multiplier = 500;
8 out of 8 – win multiplier = 4000.
If user chooses 9 numbers, he will win in case when he guesses at least 4 numbers out of 9 or could not manage to guess any number. User will be payed according to the following rules:
0 out of 9 – win multiplier = 2;
4 out of 9 – win multiplier = 2;
5 out of 9 – win multiplier = 10;
6 out of 9 – win multiplier = 25;
7 out of 9 – win multiplier = 125;
8 out of 9 – win multiplier = 1000;
9 out of 9 – win multiplier = 15 000.
If user chooses 10 numbers, he will win in case when he guesses at least 5 numbers out of 10 or could not manage to guess any number. User will be payed according to the following rules:
0 out of 10 – win multiplier = 2;
5 out of 10 – win multiplier = 5;
6 out of 10 – win multiplier = 30;
7 out of 10 – win multiplier = 100;
8 out of 10 – win multiplier = 300;
9 out of 10 – win multiplier = 5 000;
10 out of 10 – win multiplier = 30 000.
Amount that have been awarded in error
Malfunction voids all payouts.

The Last Ball: A virtual game where the player’s goal is to guess the number of the last ball, randomly selected by the system from 20 balls. A player chooses the quantity of the balls (one to ten) and the number of the balls which he has to guess. There are eighty balls numbered from 1 up to 80. During the draw game, the system throws 20 balls at random, from 1 to 80. The durations of the session is fixed.
Player is also able to use “quick bet” function, when system randomly generates 3, 4, 5, 6, 7, 8, 9 or 10 numbers and user can bet on their favorite. 
Possible outcome depends on how many numbers are chosen by user correctly and if it’s match number of the last ball in the respective draw. 
The winning amount will be accrued to the player in case of winning according to the table below:
If user chooses one number (ball) and chosen number appears to be the last one from all, 20 numbers, player will win 60X of his bet.
If user chooses 2 numbers (ball) and one of them appears to be the last one from all, 20 numbers, player will win 30X of his bet.
If user chooses 3 numbers (ball) and one of them appears to be the last one from all, 20 numbers, player will win 20X of his bet.
If user chooses 4 numbers (ball) and one of them appears to be the last one from all, 20 numbers, player will win 15X of his bet.
If user chooses 5 numbers (ball) and one of them appears to be the last one from all, 20 numbers, player will win 12X of his bet.
If user chooses 6 numbers (ball) and one of them appears to be the last one from all, 20 numbers, player will win 10X of his bet.
If user chooses 7 numbers (ball) and one of them appears to be the last one from all, 20 numbers, player will win 8X of his bet.
If user chooses 8 numbers (ball) and one of them appears to be the last one from all, 20 numbers, player will win 7X of his bet.
If user chooses 9 numbers (ball) and one of them appears to be the last one from all, 20 numbers, player will win 6X of his bet.
If user chooses 10 numbers (ball) and one of them appears to be the last one from all, 20 numbers, player will win 5X of his bet.
Malfunction voids all payouts.

